def x_bar(sig, mu, S, n):
  list_ = []
  for i in sig:
    z1 = stats.norm.ppf(i)
    z2 = stats.norm.ppf(1-i)
    x1 = ((z1*S/math.sqrt(n))+mu)
    x2 = ((z2*S/math.sqrt(n))+mu)
    a = (round(x1,2),round(x2,2))
    list_.append(a)
  return list_ # Fixed indentation here


